pragma solidity 0.8.7;

/**
 * EtherSplitter
 * Splits transferred Ether
 */

contract EtherSplitter {
    address payable user1;
    address payable user2;

    constructor(address payable _user1, address payable _user2) {
        user1 = _user1;
        user2 = _user2;
    }

    modifier ethNeeded {
        require(msg.value > 0, "You must provide ETH to be split between addresses");
        _;
    }

    function pay(address payable addr, uint sum) private returns (uint amount_left) {
        bool check;
        check = addr.send(sum);
        if (check == false) {
            return sum;
        }
        return 0;
    }

    function eth_split() payable public ethNeeded returns (bool ok) {
        uint eth = msg.value;
        uint payable_eth = eth / 2;
        uint return_to_sender = eth % 2;

        return_to_sender += pay(user1, payable_eth);
        return_to_sender += pay(user2, payable_eth);

        if (return_to_sender != 0) {
            payable (msg.sender).transfer(return_to_sender);
        }
        return true;
    }
}

